import React, { useState } from 'react';
import { Card, Form, Button, Alert } from 'react-bootstrap';
import { useNavigate, Link } from 'react-router-dom';
import { authAPI } from '../services/api';
import '../styles/AnimatedLogin.css'; // Import the new CSS

const Register = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    firstName: '',
    lastName: '',
    role: 'STUDENT'
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    try {
      await authAPI.register(formData);
      setSuccess('Registration successful! Redirecting to login...');
      setTimeout(() => navigate('/login'), 2000);
    } catch (err) {
      setError('Registration failed. Please check your details and try again.');
      console.error(err);
    }
  };

  return (
    <div className="animated-container">
      <div className="top"></div>
      <div className="bottom"></div>
      <div className="center">
        <Card style={{ width: '100%', border: 'none', background: 'transparent' }}>
          <Card.Header as="h2" className="text-center" style={{ border: 'none', background: 'transparent' }}>
            Create Account
          </Card.Header>
          <Card.Body>
            {success && <Alert variant="success">{success}</Alert>}
            {error && <Alert variant="danger">{error}</Alert>}
            <Form onSubmit={handleSubmit}>
              {/* Form fields */}
              <Form.Group className="mb-2" controlId="username">
                <Form.Control type="text" name="username" placeholder="Username" value={formData.username} onChange={handleChange} required />
              </Form.Group>
              <Form.Group className="mb-2" controlId="email">
                <Form.Control type="email" name="email" placeholder="Email" value={formData.email} onChange={handleChange} required />
              </Form.Group>
              <Form.Group className="mb-2" controlId="password">
                <Form.Control type="password" name="password" placeholder="Password" value={formData.password} onChange={handleChange} required />
              </Form.Group>
              <Form.Group className="mb-2" controlId="firstName">
                <Form.Control type="text" name="firstName" placeholder="First Name" value={formData.firstName} onChange={handleChange} required />
              </Form.Group>
              <Form.Group className="mb-2" controlId="lastName">
                <Form.Control type="text" name="lastName" placeholder="Last Name" value={formData.lastName} onChange={handleChange} required />
              </Form.Group>
              <Button variant="primary" type="submit" className="w-100 mt-2">
                Sign Up
              </Button>
            </Form>
          </Card.Body>
          <Card.Footer className="text-center" style={{ border: 'none', background: 'transparent' }}>
            Already have an account? <Link to="/login">Sign In</Link>
          </Card.Footer>
        </Card>
      </div>
    </div>
  );
};

export default Register;
